import logo from './logo.svg';
import './App.css';
import React, {Component} from 'react';

const list = [
    {
        "id": 1,
        "title": "1st todo",
        "body": "my first todo task"},
    {
        "id": 2,
        "title": "Second item",
        "body": "Second task on a todo list"
    },
    {
        "id": 3,
        "title": "Learn HTTP",
        "body": "HTTP request on the todo app"}
]

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {list};
    }

    render() {
        return (
            <div>
                {this.state.list.map(item => (
                    <div key={item.id}>
                        <h1>{item.title}</h1>
                        <p>{item.body}</p>
                    </div>
                ))}
            </div>
        );
    }
}


export default App;
